import React, { useState, useEffect } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";
import { Link } from "react-router-dom";

function MyTickets() {
  const [tickets, setTickets] = useState([]);
  const [selectedTicket, setSelectedTicket] = useState(null);

  useEffect(() => {
    const storedTickets = JSON.parse(localStorage.getItem("tickets")) || [];
    const sortedTickets = storedTickets.sort((a, b) => b.id - a.id);
    setTickets(sortedTickets);
  }, []);

  const statusStyles = (statut) => ({
    padding: "0.3rem 0.8rem",
    borderRadius: "4px",
    fontSize: "0.85rem",
    backgroundColor: {
      "Ouvert": "#ffebee",
      "En cours": "#e3f2fd",
      "Résolu": "#e8f5e9",
    }[statut],
    color: {
      "Ouvert": "#c62828",
      "En cours": "#1565c0",
      "Résolu": "#2e7d32",
    }[statut],
    fontWeight: "bold",
  });

  return (
    <>
      <IndexNavbar />

      <div style={container}>
        <div style={contentWrapper}>
          <h1 style={title}>Mes Tickets de Support</h1>
          <div style={headerActions}>
            <Link to="/new-ticket" style={newTicketButton}>
              + Nouveau Ticket
            </Link>
          </div>

          <div style={ticketGrid}>
            <div style={ticketList}>
              {tickets.length === 0 ? (
                <div style={noTicketsStyle}>
                  Aucun ticket trouvé.{" "}
                  <Link to="/new-ticket" style={createLink}>
                    Créer un nouveau ticket
                  </Link>
                </div>
              ) : (
                tickets.map((ticket) => (
                  <div 
                    key={ticket.id}
                    style={ticketItem} 
                    onClick={() => setSelectedTicket(ticket)}
                  >
                    <div style={ticketHeader}>
                      <span style={ticketId}>#{ticket.id}</span>
                      <span style={statusStyles(ticket.statut)}>{ticket.statut}</span>
                    </div>
                    <h3 style={ticketTitle}>{ticket.sujet}</h3>
                    <div style={ticketInfos}>
                      <span style={ticketDepartment}>{ticket.departement}</span>
                      <span style={ticketPriority}>{ticket.priorite}</span>
                    </div>
                    <p style={ticketDate}>{ticket.date}</p>
                  </div>
                ))
              )}
            </div>

            {selectedTicket && (
              <div style={detailsPanel}>
                <div style={detailsHeader}>
                  <h2 style={detailsTitle}>Détails du Ticket #{selectedTicket.id}</h2>
                  <button style={closeButton} onClick={() => setSelectedTicket(null)}>×</button>
                </div>
                
                <div style={detailsContent}>
                  <div style={detailRow}>
                    <span style={detailLabel}>Statut :</span>
                    <span style={statusStyles(selectedTicket.statut)}>{selectedTicket.statut}</span>
                  </div>
                  
                  <div style={detailRow}>
                    <span style={detailLabel}>Département :</span>
                    <span>{selectedTicket.departement}</span>
                  </div>

                  <div style={detailRow}>
                    <span style={detailLabel}>Priorité :</span>
                    <span>{selectedTicket.priorite}</span>
                  </div>

                  <div style={detailRow}>
                    <span style={detailLabel}>Date :</span>
                    <span>{selectedTicket.date}</span>
                  </div>

                  <div style={detailDescription}>
                    <p style={detailLabel}>Description :</p>
                    <p style={descriptionText}>{selectedTicket.description}</p>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles
const container = { 
  flex: 1, 
  display: "flex", 
  padding: "2rem", 
  backgroundColor: "#f4f6f8",
  minHeight: "100vh"
};

const contentWrapper = { 
  width: "100%", 
  maxWidth: "1200px",
  margin: "0 auto"
};

const title = { 
  color: "#1a237e", 
  fontSize: "2rem", 
  marginBottom: "1.5rem",
  fontWeight: "600"
};

const headerActions = {
  display: "flex",
  justifyContent: "flex-end",
  marginBottom: "2rem"
};

const newTicketButton = {
  backgroundColor: "#1a237e",
  color: "white",
  padding: "0.8rem 1.5rem",
  borderRadius: "6px",
  textDecoration: "none",
  fontWeight: "500"
};

const ticketGrid = { 
  display: "grid", 
  gap: "2rem", 
  gridTemplateColumns: "1fr 1fr"
};

const ticketList = { 
  backgroundColor: "#fff", 
  borderRadius: "8px", 
  padding: "1.5rem",
  boxShadow: "0 2px 8px rgba(0,0,0,0.08)"
};

const ticketItem = { 
  backgroundColor: "#f8f9fa", 
  borderRadius: "6px", 
  padding: "1.25rem", 
  marginBottom: "1rem", 
  cursor: "pointer", 
  transition: "all 0.2s ease",
  ":hover": {
    transform: "translateY(-2px)",
    boxShadow: "0 4px 12px rgba(0,0,0,0.1)"
  }
};

const ticketHeader = { 
  display: "flex", 
  justifyContent: "space-between", 
  alignItems: "center", 
  marginBottom: "0.75rem"
};

const ticketId = { 
  color: "#666", 
  fontSize: "0.85rem",
  fontWeight: "500"
};

const ticketTitle = { 
  fontSize: "1.1rem", 
  color: "#333", 
  margin: "0 0 0.75rem 0",
  fontWeight: "600"
};

const ticketInfos = {
  display: "flex",
  gap: "1rem",
  marginBottom: "0.5rem"
};

const ticketDepartment = {
  backgroundColor: "#e8eaf6",
  color: "#1a237e",
  padding: "0.3rem 0.6rem",
  borderRadius: "4px",
  fontSize: "0.85rem"
};

const ticketPriority = {
  backgroundColor: "#fff3e0",
  color: "#ef6c00",
  padding: "0.3rem 0.6rem",
  borderRadius: "4px",
  fontSize: "0.85rem"
};

const ticketDate = { 
  color: "#999", 
  fontSize: "0.85rem", 
  margin: "0"
};

const detailsPanel = { 
  backgroundColor: "#fff", 
  borderRadius: "8px", 
  padding: "2rem", 
  boxShadow: "0 2px 8px rgba(0,0,0,0.08)",
  position: "sticky",
  top: "2rem"
};

const detailsHeader = { 
  display: "flex", 
  justifyContent: "space-between", 
  alignItems: "center", 
  marginBottom: "2rem"
};

const detailsTitle = { 
  fontSize: "1.5rem", 
  color: "#1a237e", 
  margin: "0",
  fontWeight: "600"
};

const closeButton = { 
  background: "none", 
  border: "none", 
  fontSize: "1.5rem", 
  color: "#666", 
  cursor: "pointer", 
  padding: "0 0.5rem",
  ":hover": {
    color: "#000"
  }
};

const detailsContent = { 
  lineHeight: "1.6" 
};

const detailRow = { 
  display: "flex", 
  justifyContent: "space-between", 
  marginBottom: "1.25rem", 
  paddingBottom: "1.25rem", 
  borderBottom: "1px solid #eee"
};

const detailLabel = { 
  color: "#666", 
  fontWeight: "500", 
  marginRight: "1rem"
};

const detailDescription = { 
  marginTop: "2rem" 
};

const descriptionText = {
  whiteSpace: "pre-wrap",
  lineHeight: "1.6",
  backgroundColor: "#f8f9fa",
  padding: "1rem",
  borderRadius: "6px"
};

const noTicketsStyle = {
  textAlign: "center",
  color: "#666",
  padding: "3rem",
  fontSize: "1.1rem"
};

const createLink = {
  color: "#1a237e",
  fontWeight: "500",
  textDecoration: "none",
  ":hover": {
    textDecoration: "underline"
  }
};

export default MyTickets;
